window.bookSummaryJSON = "<p>It's been three years Bethany Anne and her team have been building, trying their best to stay off the radar and not fight with those they are trying to save.</p> <p>The emotions have boiled to the surface.</p> <p>The is a line drawn in the sand, and some idiots just have to step across it.</p> <p>Those that thought the cat didn't have claws are about to find out how very, very wrong they are.</p> <p>Performed by Colleen Delany, Emily Beresford, Amanda Forstrom, Anthony Palmini, Michael John Casey, Lily Beacon, David Engel, Jacob Yeh, Holly Adams, Nick Russo, Steve Wannall, Elias Khalil, Nora Achrati, Danny Gavigan, Tyler Hyrchuk, Paul Reisman, James Konicek, Matthew Pauli, James Lewis, Zeke Alton, Sara Matsui-Colby, Michael Glenn, Rose Elizabeth Supan, Mort Shelby, Rob McFadyen, Terence Aselford, David Cui Cui, Nanette Savard, Christopher Graybill, Bradley Foster Smith, Christopher Walker, Ken Jackson, Richard Rohan, Christopher Williams, Keval Shah, Tony Nam, Marni Penning, Lise Bruneau, Eric Messner, Wyn Delano, JW Rone, Evan Casey, Scott McCormick, Yasmin Tuazon, Bianca Bryan, Karen Novack, Andy Clemence, Triya Leong, Rayner Gabriel, David Jourdan, Matthew Bassett, Ryan Carlo Dalusung, Jonathan Lee Taylor, Matthew Schleigh, Catherine Aselford, Julie-Ann Elliott, and Emlyn MacFarland.</p>"; 
